import React, { Component } from 'react'
import Cart from './components/Cart'
import About from './components/About'
import Contact from './components/Contact'
import {Navbar, Nav} from 'react-bootstrap'
import 'bootstrap/dist/css/bootstrap.min.css';
import Image from 'react-bootstrap/Image'
import NotFound from './component/NotFound'
import './App.css';
import {
  BrowserRouter,
  Switch,
  Route,
  Link,
  NavLink
} from "react-router-dom";

export default class Navigation extends Component {
    render() {
        return (
            <div>
<Navbar bg="dark">
    <Navbar.Brand>
          <Nav className="navi">
            {/* you can use NavLink to CSS the links */}
        <Link to="/" className="ml-auto" className="navg">Home</Link>
        <Link to="/about" className="ml-auto" className="navg">About</Link>
        <Link to="/gallary"  className="ml-auto" className="navg">Gallary</Link>
        <Link to="/contact"  className="ml-auto" className="navg">Contact</Link>
          </Nav>
    </Navbar.Brand>
  </Navbar>
            </div>
        )
    }
}
